          getQRFunc: function(codeBarraVista2){
            return new Promise(function (resolve, reject) {
            var uri = "https://chart.googleapis.com/chart?cht=qr&chs=150x150&chl="+codeBarraVista2;
            // var uri = "https://barcodeapi.org/api/Testx1";
            var xhr = new XMLHttpRequest();
            xhr.onload = function() {
            var reader = new FileReader();
            reader.onloadend = function() {
                var result = reader.result;
                resolve(result);
            }
            reader.readAsDataURL(xhr.response);
            };
            xhr.open('GET', uri);
            xhr.responseType = 'blob';
            xhr.send();
              });
          },

          getBarcode: function(codeBarraVista2){
            var doc = document.implementation.createDocument ('http://www.w3.org/1999/xhtml', 'html', null);
            var svgNode = document.createElementNS('http://www.w3.org/2000/svg', 'svg');

            JsBarcode(svgNode, codeBarraVista2, {
                xmlDocument: document,
            });
            const xmlSerializer = new XMLSerializer();
            var svgText = xmlSerializer.serializeToString(svgNode);
            return svgText;
          }
